      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n\n{\n\"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es una metodologia de gestion de proyectos?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"La gestión de proyectos es un conjunto de metodologías para planificar y dirigir los procesos de un proyecto. Un proyecto comprende un cúmulo específico de operaciones diseñadas para lograr un objetivo con un alcance, recursos, inicio y final establecidos. Si ya está familiarizado con las bases de los diferentes tipos de metodologías de gestión de proyectos, esto lo ayudará a tomar la decisión correcta al elegir una técnica para un proyecto en particular.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Cuáles son las diferentes metodologías de gestión de proyectos?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Los tipos más populares de metodologías de gestión de proyectos son: \u003Cul\u003E\u003Cli\u003EAgile\u003C\/li\u003E \u003Cli\u003EScrum\u003C\/li\u003E\u003Cli\u003EWaterfall (Modelo en Cascada)\u003C\/li\u003E\u003Cli\u003EKanban\u003C\/li\u003E\u003Cli\u003EGantt\u003C\/li\u003E\u003Cli\u003ELean\u003C\/li\u003E\u003C\/ul\u003E Desglosamos los componentes más importantes de cada método de diferentes herramientas que se utilizan en un proyecto, y también discutimos sus ventajas y desventajas.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es metodología Agile?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Metodología AGILE es mucho más que una metodología para gestión de proyectos que precisan de rapidez y flexibilidad, es una filosofía que supone una forma distinta de trabajar y de organizarse. Ser rápido en la entrega de un trabajo, aunque sea imperfecta, el producto es una parte clave del enfoque ágil.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es el scrum y para qué sirve?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Scrum es una de las metodologías (framework), usado en equipos que trabajan en la gestión de proyectos. Básicamente es un marco de trabajo para desarrollo ágil de software y tiene como finalidad la entrega de valor en períodos cortos de tiempo, basada tres pilares: la transparencia, inspección y adaptación.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es el Kanban y para qué sirve?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"En la filosofía Kanban, todo se presenta de forma visual y sencilla y es excelente para la gestión de proyectos. Kanban es un tablero con notas adhesivas o un software de computadora correspondiente. Los tableros Kanban tienen varias columnas: lista de tareas pendientes, trabajo en progreso y tareas completadas\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es un diagrama de Gantt y para qué sirve?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"El diagrama de Gantt es una herramienta para planificar y programar tareas y gestión de proyectos a lo largo de un período determinado. Gracias a una fácil y cómoda visualización de las acciones previstas, permite realizar el seguimiento y control del progreso de cada una de las etapas de un proyecto y, además, reproduce gráficamente las tareas, su duración y secuencia, además del calendario general del proyecto.\"\n    }\n  }]\n};\n\u003C\/script\u003E",
