      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n\n{\n\"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es el Kanban y para qué sirve?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Tablero Kanban es una de las formas de implementar la metodología Agile. Sirve para visualizar la cantidad de trabajo en tiempo real y simple. Además, es un método simple pero efectivo, que permite una gestión de proyectos muy eficaz.\"\n    }\n  },{ \n    \"@type\": \"Question\",\n    \"name\": \"¿Cómo funciona el sistema Kanban?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"El sistema Kanban funiona de la siguiente manera: \u003Cul\u003E\u003Cli\u003EA través de la visualización\u003C\/li\u003E\u003Cli\u003EGestión de flujo de trabajo\u003C\/li\u003E\u003Cli\u003ETransparencia\u003C\/li\u003E\u003Cli\u003ELímites de trabajo en progreso\u003C\/li\u003E\u003C\/ul\u003E Básicamente, todo lo que necesita para usar el sistema de administración Kanban es un tablero y notas adhesivas o un software de computadora correspondiente.\n\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué significa la palabra Kanban?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"La palabra Kanban representa a otra forma de implementar la metodología Agile en la gestión de proyectos. Es bastante similar a Scrum, ya que también tiene personal autoorganizado e independiente, pero al mismo tiempo hay ciertas diferencias.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es la metodologia de Kanban?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Básicamente, todo lo que necesita para usar el sistema de administración Kanban es un tablero y notas adhesivas o un software de computadora correspondiente. Los tableros Kanban tienen varias columnas: lista de tareas pendientes, trabajo en progreso y tareas completadas. Funciona a través de la A través de la visualización, Gestión de flujo de trabajo, Transparencia y Límites de trabajo en progreso.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Qué es el proceso de Kanban?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Los tableros Kanban tienen varias columnas: lista de tareas pendientes, trabajo en progreso y tareas completadas. Una vez que una tarea se completa o se pone en funcionamiento, se transfiere a otra columna. Se pueden crear secciones adicionales dependiendo de en qué etapa se encuentre el proyecto.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"¿Quién fue el creador de Kanban?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"El concepto Kanban fue creado en una fábrica de Toyota en la década de 1940. Era un método simple pero efectivo, que permitía visualizar la cantidad de trabajo en tiempo real y simple. Era y sigue siendo una herramienta sencilla que permite informar a todos los trabajadores con el sistema de símbolos visuales.\"\n    }\n  }]\n};\n\u003C\/script\u003E",
